# Histogram Equalization
I = img_gry


#size of the input image.
r,c = I.shape 

#uint 8 blamk canvas
img_eq = np.zeros([r,c]);

#number of pixels.
n = r*c;

#frequency pdf and cdf and some variables
f = np.zeros([256,1]);
pdf = np.zeros([256,1]);
cdf = np.zeros([256,1]);
out = np.zeros([256,1]);
cum = np.zeros([256,1]);


#Nested for loop

for i in range(r):
    for j in range(c):
        value = I[i,j];
        f[value] = f[value]+1;
        pdf[value] = f[value]/n;

#finding cdf
sum = 0;
L = 255;

for i in range(pdf.shape[0]):
    sum = sum + f[i];
    cum[i] = sum;
    cdf[i] = (cum[i]+1)/n;
    out[i] = np.round(cdf[i]*L);


for i in range(r):
    for j in range(c):
        img_eq[i,j] = out[I[i,j]];

plt.subplot(1,2,1);plt.imshow(I,"gray");plt.title("original")
plt.subplot(1,2,2);plt.imshow(img_eq,"gray");plt.title("Hist Eq")
